export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},nBSi50L1iU:{data:{id:372,attributes:{imdbId:"tt0758774",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTgzOTY3MTM0OV5BMl5BanBnXkFtZTcwNjc5MTI5MQ@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.1\u002F10"},{Source:"Rotten Tomatoes",Value:"55%"},{Source:"Metacritic",Value:"57\u002F100"}],item_lang:{data:{id:1035,attributes:{title:h,plot:"Roger Ferris is a CIA operative in the Middle East; Ed Hoffman is his control at Langley. Cynicism is everywhere. In Amman, Roger works with Hani Salaam, Jordan's head of security, whose only dictum is \"Don't lie to me.\" The Americans are in pursuit of a cleric who leads a group placing bombs all over Europe. When Hani rebukes Ed's demand that Jordan allow the Americans to use one of Jordan's double agents, Roger and Ed hatch a plan to bring the cleric to them. The plan is complicated by its being a secret from Hani and by Roger's attraction to a local nurse. Satellites and cell phones, bodies and lies: modern warfare.",slug:"body-of-lies"}}},books:{data:[{id:3300,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:true,published:l,publisher:d,subtitle:a}},{id:3301,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:e,published:l,publisher:d,subtitle:a}},{id:3302,attributes:{title:h,description:"Body of Lies is fiction but reads like fact. Fascinating. -George Tenet, former director, CIA Roger Ferris is one of the CIA's soldiers in the war on terrorism. He has come out of Iraq with a shattered leg and an intense missionto penetrate the network of a master terrorist known only as Suleiman.Ferris's plan for getting inside Suleiman's tent is inspired by a masterpiece of British intelligence during World War II: He prepares a body of lies, literally the corpse of an imaginary CIA officer who appears to have accomplished the impossible by recruiting an agent within the enemy's ranks. This scheme binds friend and foe in a web of extraordinary subtlety and complexity, and when it begins to unravel, Ferris finds himself flying blind into a hurricane. His only hope is the urbane head of Jordan's intelligence serviceman who might be an Arab version of John le CarrÃ's celebrated spy, George Smiley. But can Ferris trust him? This is a riveting imagined world, so real in fact that one always wonders if it is imagined after all. -Scott Turow",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AdyzswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2007-12-01",publisher:a,subtitle:a}},{id:3303,attributes:{title:"Agents of Innocence: A Novel",description:"A \"superlative spy novel\" (New York Times) by the author of the bestselling espionage thrillers Body of Lies and The Director. Agents of Innocence is the book that established David Ignatius's reputation as a master of the novel of contemporary espionage. Into the treacherous world of shifting alliances and arcane subterfuge comes idealistic CIA man Tom Rogers. Posted in Beirut to penetrate the PLO and recruit a high-level operative, he soon learns the heavy price of innocence in a time and place that has no use for it.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=e1caYCGMI9UC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2011-02-14",publisher:d,subtitle:a}},{id:3304,attributes:{title:"The Bank of Fear: A Novel",description:"\"Sizzling…engrossing all the way.\" —Los Angeles Times Book Review Hit men stalk computer analyst Lina Alwen and financial investigator Sam Hoffman in pursuit of the knowledge the pair may have regarding a late Iraqi dictator’s billions. From London to Switzerland, and from Baghdad to the mysterious corners of the just-budding Internet, this spy thriller covers the map to uncover a world of corruption.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zDqpYG6wMlYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2013-05-28",publisher:d,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309149671}}("","David Ignatius","movie","W. W. Norton & Company",null,"series",1,"Body of Lies","Body of Lies: A Novel","The novel made into the major motion picture released October 2008, starring Leonardo DiCaprio and Russell Crowe: \"Clever [and] well-paced, Body of Lies is hard to put down.\"—John Miller, Wall Street Journal CIA soldier Roger Ferris has come out of Iraq with a shattered leg and an intense mission— to penetrate the network of a master terrorist known only as \"Suleiman.\" Ferris's plan is inspired by a masterpiece of British intelligence during World War II: He prepares a body of lies, literally the corpse of an imaginary CIA officer who appears to have accomplished the impossible by recruiting an agent within the enemy's ranks.This scheme binds friend and foe in a web of extraordinary subtlety and complexity. When it begins to unravel, Ferris finds himself flying blind into a hurricane. His only hope is the urbane head of Jordan's intelligence service. But can Ferris trust him?","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=N0YBKhKKHcwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2008-04-17"))